import React from 'react'

export default function SearchResults(props) {

  const data = props.data.slice(0, 5);
  const textstate = props.textstate;

  if(textstate !== ''){
  return (
    <div className="results">
        {data.map((data, index) => {
          return (
            <div className="results__list" key={index}>
              <ul key={index}>
                <a href={data.id} onClick>
                <li key={index}>{data.original_title}</li><br/>
                <span>{data.vote_average} Rating, {(undefined)?'date':(data.release_date.slice(0, 4))}</span>
                </a>
              </ul>
            </div>
          )
        })}
    </div>
  )
  }else{
    return null;
  }
}
